export interface IFilter {
  id: number,
  name: string,
  type: string,
  display: string,
  options:
    {
      id: number,
      name?: string,
      value: string | number,
      display: string,
      isChecked?: boolean
    }[]
}

export const filters: IFilter[] = [
  {
    id: 1,
    name: 'price',
    type: 'range',
    display: 'Стоимость',
    options: [
      {
        id: 1,
        name: 'minPrice',
        value: 0,
        display: 'Изменить минимальную цену',
      },
      {
        id: 2,
        name: 'maxPrice',
        value: 5000,
        display: 'Изменить максимальную цену',
      }
    ]
  },
  {
    id: 2,
    name: 'color',
    type: 'checkbox',
    display: 'Цвет',
    options: [
      {
        id: 1,
        value: 'black',
        display: 'Черный',
        isChecked: true
      },
      {
        id: 2,
        value: 'white',
        display: 'Белый',
        isChecked: true
      },
      {
        id: 3,
        value: 'blue',
        display: 'Синий',
        isChecked: false
      },
      {
        id: 4,
        value: 'red',
        display: 'Красный',
        isChecked: false
      },
      {
        id: 5,
        value: 'pink',
        display: 'Розовый',
        isChecked: false
      },
    ]
  },
  {
    id: 3,
    name: 'bluetooth',
    type: 'radio',
    display: 'Bluetooth',
    options: [
      {
        id: 1,
        value: 'yes',
        display: 'Есть',
        isChecked: true
      },
      {
        id: 2,
        value: 'no',
        display: 'Нет',
        isChecked: false
      }
    ]
  }
];
